script: |
  super -f text -I q11675.spq | sort > q11675.out

inputs:
  - name: q11675.spq
    data: |
      SELECT * FROM tab2 (FORMAT parquet) WHERE NOT ( + col0 * 46 ) BETWEEN ( - ( + ( 94 ) ) ) + + + col0 AND ( col0 ) * + col2;
  - name: tab2

outputs:
  - name: q11675.out
    data: |
      46	51	23
      64	77	40
